import React from 'react';

const DepthFirstSearchInformation = () => {
    return (
        <div className="information">
            <h1>Depth First Search</h1>
            <p>Depth first search is an algorithm to search for a value in a tree data structure. Every node is traversed in a certain order until either the value is found, or every node in the tree has been visited.</p>
        </div>
    );
}

export default DepthFirstSearchInformation;
